        </style>
        <style>
            html,
            body {
                overflow-x: hidden;
            }

            body {
                padding-top: 56px;
            }

            table {
                font-size: .875rem;
            }

            .footer {
                text-align: center;
                background-color: #ffffff;
                width: 100%;
            }

            table .fa-fw {
                margin-right: 5px;
                color: #2e2e2e;
            }

            table .tree-entity {
                width: 100%;
            }

            table .tree-entity:hover {
                cursor: pointer;
            }

            .underline-hover:hover {
                text-decoration: underline;
            }

            table thead tr th {
                font-weight: normal;
            }

            .matrix {
                margin-top: 20px;
                margin-bottom: 10px;
                border: 1px solid #e5e5e5;
                border-radius: 4px;
                display: block;
                overflow-x: auto;
                white-space: nowrap;
            }

            .matrix table thead tr th,
            .matrix table tbody tr td {
                padding-top: 8px;
                padding-bottom: 8px;
                padding-left: 8px;
                padding-right: 8px;
                border-left: 1px solid rgb(229, 229, 229);
                border-right: 1px solid rgb(229, 229, 229);
            }

            .logo {
                display: block;
                margin-left: auto;
                margin-right: auto;
                width: 180px;
                margin-top: 5px;
            }

            .info-block {
                display: inline-block;
                width: 11px;
                height: 11px;
                line-height: 1;
                border-radius: 3px;
            }

            .rounded {
                border: 1px solid #e5e5e5;
            }

            table thead tr th,
            table tbody tr td {
                padding-top: 10px;
